    // },[])

    return(
        <div>
              <div class="table-responsive">
                    <table class="table table-bordered">
                        <thead class="thead-dark">
                            <tr>
                                <th>ProductId</th>
                                <th>ProductName</th>
                                <th>ProductPrice</th>
                                <th>Category</th>
                                <th>View</th>
                            </tr>
                        </thead>
                        <tbody>
                            {
                                products.map(p =>
                                    <tr>
                                        <td>{p.productId}</td>
                                        <td>{p.productName}</td>
                                        <td>{p.productPrice}</td>
                                        <td>{p.category}</td>
                                        <td><Link to={`/product/find/${p.productId}`}>View</Link></td>
                                    </tr>
                                )}
                        </tbody>
                    </table>
                </div>

        </div>
    )
}

export default ViewResturant;
